import React, { Fragment, useState } from 'react';
import PropTypes from 'prop-types';
import TwentyFourtyEight from './TwentyFourtyEight.js';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import {
  Grid,
  Avatar,
  Box,
  Typography,
  Dialog,
  Badge,
  Card,
  CardContent,
  Button,
  Tooltip,
  FormControl
} from '@material-ui/core';

import people3 from '../templates/assets/images/stock-photos/people-3.jpg';


function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <Typography
      component="div"
      role="tabpanel"
      hidden={value !== index}
      {...other}>
      {value === index && <Box p={4}>{children}</Box>}
    </Typography>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired
};

const Modal = () => {
  const [modal3, setModal3] = useState(true);
  const toggle3 = () => setModal3(!modal3);
  const [value, setValue] = React.useState(0);
  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const [checked1, setChecked1] = React.useState(true);

  const handleChange1 = event => {
    setChecked1(event.target.checked);
  };
  return (
    <div>

    <Fragment>
      <Dialog scroll="body" maxWidth="md" open={modal3} onClose={toggle3}>
        <Grid container spacing={0}>
          <Grid>
            <TwentyFourtyEight />
          </Grid>
        </Grid>
      </Dialog>
    </Fragment>
    </div>
  );
};

export default Modal;
